import{_ as e,c as t,o as i,b as n}from"./app-BVPl4dcd.js";const o={},s=n('<h1 id="data-model" tabindex="-1"><a class="header-anchor" href="#data-model"><span>Data Model</span></a></h1><p><strong>User/Employee</strong> The User/Employee entity stores all user-related data, including personal, system, and professional details.</p><ul><li><strong>id (Primary Key)</strong>: A unique identifier for the user.</li><li><strong>system_details</strong>: Stores system-related information such as email, password, and username.</li><li><strong>personal_info</strong>: Contains personal details like first name, surname, date of birth, gender, preferred language, contact information (phone, email), and address (street, suburb, city, postal code, complex, house number).</li><li><strong>profile</strong>: Holds profile-specific data such as display image and display name.</li><li><strong>roles</strong>: An array of roles with associated permissions.</li><li><strong>joined_companies</strong>: A list of companies the user is associated with.</li><li><strong>skills</strong>: A list of the user&#39;s skills.</li><li><strong>availability</strong>: Indicates the user&#39;s availability status and schedule.</li><li><strong>current_job_assignments</strong>: A list of job assignments linked to the user.</li></ul><p><strong>Company</strong> The Company entity stores information about different companies.</p><ul><li><strong>id (Primary Key)</strong>: A unique identifier for the company.</li><li><strong>registration_number</strong>: The company&#39;s registration number.</li><li><strong>name</strong>: The name of the company.</li><li><strong>type</strong>: The type of business the company operates.</li><li><strong>vat_number</strong>: The company&#39;s VAT number.</li><li><strong>logo</strong>: The company&#39;s logo.</li><li><strong>contact_details</strong>: Contact information including phone and email.</li><li><strong>address</strong>: The company&#39;s address, comprising street, suburb, city, and postal code.</li><li><strong>employees</strong>: A list of employee IDs associated with the company.</li><li><strong>inventory_items</strong>: A list of inventory item IDs managed by the company.</li></ul><p><strong>Client</strong> The Client entity stores information about clients.</p><ul><li><strong>id (Primary Key)</strong>: A unique identifier for the client.</li><li><strong>details</strong>: Contains client-specific details such as first name, surname, contact information (phone, email), and address (street, suburb, city, postal code, complex, house number).</li></ul><p><strong>Job</strong> The Job entity stores details about various jobs.</p><ul><li><strong>id (Primary Key)</strong>: A unique identifier for the job.</li><li><strong>client_id</strong>: A reference to the client associated with the job.</li><li><strong>assigned_employees</strong>: A list of employee IDs assigned to the job.</li><li><strong>scheduled_date_time</strong>: The scheduled date and time for the job.</li><li><strong>status</strong>: The current status of the job (e.g., pending, in progress, completed).</li><li><strong>inventory_used</strong>: A list of inventory items used in the job, including item IDs and quantities.</li><li><strong>job_details</strong>: Detailed information about the job, including description, notes, address, and images.</li><li><strong>client_feedback</strong>: Feedback from the client, including job rating, customer service rating, and comments.</li></ul><p><strong>Appointment</strong> The Appointment entity stores information about appointments.</p><ul><li><strong>id (Primary Key)</strong>: A unique identifier for the appointment.</li><li><strong>client_id</strong>: A reference to the client associated with the appointment.</li><li><strong>job_id</strong>: A reference to the job related to the appointment.</li><li><strong>scheduled_date_time</strong>: The scheduled date and time for the appointment.</li><li><strong>duration</strong>: The duration of the appointment in minutes.</li><li><strong>status</strong>: The current status of the appointment (e.g., pending, confirmed, cancelled).</li></ul><p><strong>InventoryItem</strong> The InventoryItem entity stores details about inventory items.</p><ul><li><strong>id (Primary Key)</strong>: A unique identifier for the inventory item.</li><li><strong>name</strong>: The name of the inventory item.</li><li><strong>image_or_icon</strong>: The image or icon representing the inventory item.</li><li><strong>cost_price</strong>: The cost price of the inventory item.</li><li><strong>current_stock_level</strong>: The current stock level of the inventory item.</li><li><strong>low_stock_threshold</strong>: The stock level threshold indicating when the item is considered low on stock.</li></ul>',13),r=[s];function a(l,d){return i(),t("div",null,r)}const m=e(o,[["render",a],["__file","dataModel.html.vue"]]),c=JSON.parse('{"path":"/databaseDocs/dataModel.html","title":"Data Model","lang":"en-US","frontmatter":{},"headers":[],"git":{"updatedTime":1717193035000,"contributors":[{"name":"JessicaBloem","email":"jessicabloem8@gmail.com","commits":2}]},"filePathRelative":"databaseDocs/dataModel.md"}');export{m as comp,c as data};
